import React from 'react';

function Universe() {
    return ( 
        <div className="container mt-5 ">
    <div className="row ">
        <h1></h1>
        <p></p>
        <div className="col-6 p-5 mt-5">
            <h1>{productName}</h1>
            <p>{productDescription}</p>
            <div>
                <a href={learnMore} >Learn More</a>
            </div>
        </div>
        <div className="col-6 ">
            <img src={imageURL} />
        </div>
    </div>
  </div>
     );
}

export default Universe;
